import React from 'react'
import { NavLink } from 'react-router-dom'


export default class OrderButton extends React.Component {

    render() {
        return (
        <div class="bigbutton-wrap">
            <NavLink to='/'><button class="big-button" onClick={()=>{this.props.createOrder()}}>ORDER<span>No turning back from here...</span></button></NavLink>
        </div>
        )
    }

}
